    "predict1 = linear_model1.predict(x_test) # 학습된 선형 회귀 모형으로 평가 데이터 예측\n",
    "print(\"RMSE: {}\".format(np.sqrt(mean_squared_error(predict1, y_test)))) # RMSE 결과\n",
    "\n",
    "# summarize feature importance\n",
    "coefficients = pd.concat([pd.DataFrame(x_train.columns),pd.DataFrame(np.transpose(regression_model.coef_))], axis = 1)\n",
